import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import axios from 'axios';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const ASSETS = [
  { 
    key: 'sp500', 
    label: 'S&P 500', 
    endpoint: 'sp500-index', 
    color: 'rgb(75, 192, 192)',
    description: 'US Stock Market Index',
    img: '/sp500.svg'
  },
  { 
    key: 'gold', 
    label: 'Gold', 
    endpoint: 'gold-index', 
    color: 'rgb(255, 215, 0)',
    description: 'Gold Futures Price',
    img: '/gold.svg'
  },
  { 
    key: 'interest', 
    label: 'Interest Rate', 
    endpoint: 'interest-rate', 
    color: 'rgb(255, 0, 0)',
    description: '10-Year Treasury Yield',
    img: '/interest.svg'
  },
  { 
    key: 'bitcoin', 
    label: 'Bitcoin', 
    endpoint: 'bitcoin-index', 
    color: 'rgb(255, 165, 0)',
    description: 'Bitcoin USD Price',
    img: '/bitcoin.svg'
  },
  { 
    key: 'fx', 
    label: 'FX Rate', 
    endpoint: 'fx-rate', 
    color: 'rgb(0, 0, 255)',
    description: 'EUR/USD Exchange Rate',
    img: '/fx.svg'
  },
];

const SP500Return = () => {
  const [selectedAsset, setSelectedAsset] = useState<typeof ASSETS[0] | null>(null);
  const [data, setData] = useState<any>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top' as const,
      },
      title: {
        display: true,
        text: selectedAsset ? `${selectedAsset.label} - Last 10 Years` : '',
      },
    },
    scales: {
      y: {
        beginAtZero: false,
        grid: {
          color: 'rgba(0, 0, 0, 0.1)',
        },
      },
      x: {
        reverse: true,
        grid: {
          color: 'rgba(0, 0, 0, 0.1)',
        },
      },
    },
  };

  useEffect(() => {
    if (!selectedAsset) return;

    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`http://localhost:8000/api/v1/${selectedAsset.endpoint}/`, {
          params: { days: 3650 }
        });
        const chartData = {
          labels: response.data.map((item: any) => item.date),
          datasets: [
            {
              label: selectedAsset.label,
              data: response.data.map((item: any) => item.close_price),
              borderColor: selectedAsset.color,
              backgroundColor: selectedAsset.color + '20',
              fill: true,
              tension: 0.4,
              pointRadius: 0,
              borderWidth: 2,
            },
          ],
        };
        setData(chartData);
        setError(null);
      } catch (err) {
        console.error('Error fetching data:', err);
        setError('Failed to load data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [selectedAsset]);

  const handleBack = () => {
    setSelectedAsset(null);
    setData(null);
  };

  return (
    <div className="container mx-auto px-4 py-8">
      {!selectedAsset ? (
        <>
          <div style={{ 
            width: '100%', 
            height: '300px', 
            marginBottom: '2rem',
            borderRadius: '0.75rem',
            overflow: 'hidden'
          }}>
            <img 
              src="/yonsei_univ_photo.png" 
              alt="Yonsei University"
              style={{
                width: '100%',
                height: '100%',
                objectFit: 'cover'
              }}
            />
          </div>
          <div style={{ display: 'flex', flexDirection: 'row', gap: '1.5rem', overflowX: 'auto', paddingBottom: '1rem' }}>
            {ASSETS.map(asset => (
              <div
                key={asset.key}
                onClick={() => setSelectedAsset(asset)}
                style={{ 
                  minWidth: '300px',
                  padding: '1.5rem',
                  borderRadius: '0.75rem',
                  cursor: 'pointer',
                  border: '4px solid #1976d2',
                  backgroundColor: 'white',
                  transition: 'all 0.3s'
                }}
                onMouseOver={(e) => {
                  e.currentTarget.style.borderColor = '#42a5f5';
                  e.currentTarget.style.boxShadow = '0 10px 15px -3px rgba(25, 118, 210, 0.2)';
                }}
                onMouseOut={(e) => {
                  e.currentTarget.style.borderColor = '#1976d2';
                  e.currentTarget.style.boxShadow = 'none';
                }}
              >
                <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                  <img 
                    src={asset.img} 
                    alt={asset.label}
                    style={{ 
                      width: '32px',
                      height: '32px',
                      objectFit: 'contain'
                    }}
                  />
                  <div>
                    <h3 style={{ fontSize: '1.25rem', fontWeight: 'bold', color: '#1f2937' }}>{asset.label}</h3>
                    <p style={{ fontSize: '0.875rem', color: '#4b5563' }}>{asset.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </>
      ) : (
        <div className="bg-white rounded-xl shadow-lg p-6">
          <div className="flex justify-between items-center mb-6">
            <h2 className="text-2xl font-bold text-gray-800">{selectedAsset.label}</h2>
            <button
              onClick={handleBack}
              className="btn-gradient red block px-6 py-2 text-white font-medium rounded-lg transition-all duration-300 hover:shadow-lg"
              style={{
                background: 'linear-gradient(45deg, #1976d2, #42a5f5)',
                border: 'none',
                cursor: 'pointer'
              }}
            >
              ← Back to Assets
            </button>
          </div>
          {loading ? (
            <div className="flex justify-center items-center h-64">
              <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500"></div>
            </div>
          ) : error ? (
            <div className="text-red-500 text-center">{error}</div>
          ) : !data ? (
            <div className="text-center">No data available</div>
          ) : (
            <div style={{ height: '500px', width: '100%' }}>
              <Line options={options} data={data} />
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default SP500Return;
